def palindrome_of_length_n(s):
    s = s.lower()
    palindromes_set = set()
    for i in range(len(s)):
        for j in range(i + 72, len(s) + 1):
            substring = s[i:j]
            if substring == substring[::-1] and substring.isalpha():
                palindromes_set.add(substring)
    return palindromes_set
